import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion'; // For animations

// Styled container for the experience section
const ExperienceSection = styled.section`
  background-color: #f7f7f7;
  padding: 4em 2em;
  text-align: center;
`;

// Title for the section
const Title = styled.h1`
  font-size: 2.5em;
  color: #333;
  margin-bottom: 1em;
`;

// Experience list container
const ExperienceList = styled(motion.div)`
  max-width: 800px;
  margin: auto;
  text-align: left;
`;

// Experience item with width expansion on hover
const ExperienceItem = styled(motion.div)`
  margin-bottom: 2em;
  background-color: white;
  border-radius: 15px;
  padding: 2em;
  box-shadow: 0px 10px 20px rgba(0, 0, 0, 0.1);
  position: relative;
  z-index: 1;
  transition: all 0.3s ease;  /* Smooth transition for width, height, and shadow */
  max-width: 800px;
  overflow: hidden; /* Prevent overflow of content during expansion */

  &:hover {
    max-width: 900px; /* Expands the width */
    padding: 2.5em;   /* Increases padding on hover */
    box-shadow: 0px 15px 30px rgba(0, 0, 0, 0.2); /* Adds deeper shadow */
    font-smoothing: antialiased; /* Ensures smooth text rendering */
    text-rendering: optimizeLegibility; /* Optimize text rendering */
    z-index: 1000; /* Make sure it comes above other elements */
  }
`;

const JobTitle = styled.h3`
  font-size: 1.8em;
  color: #28a745;
  font-weight: bold;
  margin-bottom: 0.5em;
`;

const Company = styled.h4`
  font-size: 1.5em;
  color: #333;
  font-weight: bold;
`;

const Timeline = styled.h5`
  font-size: 1.1em;
  color: #888;
  margin-bottom: 1em;
`;

const RoleTitle = styled.h6`
  font-size: 1.2em;
  color: #555;
  font-weight: bold;
  margin-top: 1.5em;
  margin-bottom: 0.5em;
  background-color: #f0f0f0;
  padding: 0.5em;
  border-radius: 10px;
`;

const Description = styled.p`
  font-size: 1em;
  color: #555;
  line-height: 1.6;
`;

const BulletPoint = styled.li`
  font-size: 1em;
  margin: 0.5em 0;
  color: #666;
`;

const experienceVariants = {
  hidden: { opacity: 0, y: 50 },
  visible: {
    opacity: 1,
    y: 0,
    transition: { duration: 0.8, ease: 'easeInOut', staggerChildren: 0.3 },
  },
};

const Experience = () => {
  return (
    <ExperienceSection>
      <Title>My Experience</Title>
      <ExperienceList
        initial="hidden"
        animate="visible"
        variants={experienceVariants} // Apply animation to the experience list
      >
        <ExperienceItem>
          <JobTitle>Associate Software Engineer (DevOps & Full Stack)</JobTitle>
          <Company>BOSCH Global Software Technologies, Bangalore, India</Company>
          <Timeline>Jul. 2023 - Present</Timeline>

          {/* DevOps Engineer Role */}
          <RoleTitle>DevOps Engineer Role</RoleTitle>
          <Description>
            <ul>
              <BulletPoint>Architected and maintained CI/CD pipelines.</BulletPoint>
              <BulletPoint>Implemented Docker containerization.</BulletPoint>
              <BulletPoint>Authored Python and Shell automation scripts.</BulletPoint>
            </ul>
          </Description>
        </ExperienceItem>

        {/* Google Summer of Code */}
        <ExperienceItem>
          <JobTitle>Google Summer of Code Contributor</JobTitle>
          <Company>Google Summer of Code 2022 - PEcAn Projects</Company>
          <Timeline>Jun. 2022 - Sept 2022</Timeline>
          <Description>
            <ul>
              <BulletPoint>Refactored 10+ R packages for CRAN compliance.</BulletPoint>
              <BulletPoint>Optimized download process for PEcAn packages.</BulletPoint>
            </ul>
          </Description>
        </ExperienceItem>

      </ExperienceList>
    </ExperienceSection>
  );
};

export default Experience;
